    Act(stage_name="Fairground Stage", set_time="14:00", artist_name="Billie Eilish", image="https://cdn.vox-cdn.com/thumbor/VetxE6rRTJt5tLhQ2Z99QFA9zcI=/1400x1400/filters:format(jpeg)/cdn.vox-cdn.com/uploads/chorus_asset/file/16127988/56973906_1031440620389086_5150401069125206016_o.jpg", official_website="https://www.billieeilish.com/", genre="pop", bio="She first gained attention in 2015 when she uploaded the song \"Ocean Eyes\" to SoundCloud, which was subsequently released by the Interscope Records subsidiary Darkroom."),
    Act(artist_name="Red Hot Chilli Peppers", stage_name="Diamond Stage", set_time="23:00", image="https://www.nme.com/wp-content/uploads/2016/09/2014SuperBowlRedHotChilliPeppersPA-18864710030214-1.jpg", official_website="https://redhotchilipeppers.com/", genre="Rock", bio="One of the most successful acts in rock history, , which is singer Anthony Kiedis, bassist Flea, drummer Chad Smith, and guitarist Josh Klinghoffer, have sold more than 60 million albums, including five multi-platinum LPs, and won six Grammy Awards, including Best Rock Album, Best Rock Performance By a Duo or Group, Best Rock Song and Best Hard Rock Performance With Vocal. The band was inducted into the Rock and Roll Hall of Fame in April 2012. The Red Hot Chilli Peppers' last studio album, , was released by Warner Bros. Records on June 17, 2016."),
    Act(artist_name="Beyoncé", stage_name="Diamond Stage", set_time="22:00", image="https://i.pinimg.com/originals/5d/fb/3a/5dfb3adf72ce5213be0839370dac4a97.png", official_website="https://www.beyonce.com/", genre="R&B", bio="Beyoncé is one of the world's best-selling recording artists, having sold 118 million records worldwide. Her success during the 2000s was recognized with the Recording Industry Association of America's Top Certified Artist of the Decade, as well as Billboard magazine's Top Radio Songs Artist and the Top Female Artist of the Decade. Beyoncé is the most nominated woman at the Grammy Awards and has the second-most wins for a woman with a total of 24.She is also the most awarded artist at the MTV Video Music Awards, with 24 wins, including the Michael Jackson Video Vanguard Award. In 2014, she became the highest-earning Black musician in history and was listed among Time's 100 most influential people in the world for a second year in a row. Forbes ranked her as the most powerful female in entertainment on their 2015 and 2017 lists. She occupied the sixth place for Time's Person of the Year in 2016 and in 2020, was named one of the 100 women who defined the last century by the same publication."),
    Act(artist_name="Arctic Monkeys", stage_name="Diamond Stage", set_time="21:00", image="https://blog.discogs.com/wp-content/uploads/2019/11/arctic-monkeys.jpg", official_website="", genre="Rock", bio="With their nervy and literate indie rock sound, Arctic Monkeys arrived in 2005 with a blast. Assisted by rave reviews and online word of mouth (they were one of the first bands to benefit from social media), the band quickly became a sensation in the United Kingdom, where they were seen as the heir apparent to the throne left vacant by  and . Buoyed by the single I Bet You Look Good on the Dancefloor, their 2006 debut Whatever People Say I Am, That's What I'm Not briefly grabbed the title of fastest-selling album in British history. It landed on top of both the U.K. and U.S. rock album charts and took home the Mercury Prize. What set the group apart was , a singer/songwriter with a biting wit and grasp of English vernacular (not dissimilar to , the godfather of modern British rock). However, driven by their maverick creative spirit, Arctic Monkeys have proven highly unpredictable, reworking classic rock traditions on 2007's Favourite Worst Nightmare and beefing up their guitars with the assistance of 's  on 2009's Humbug. Eventually, they also laced in some of the louche lounge aspects of 's swinging side project , as on 2013's AM and 2018's arty Tranquility Base Hotel + Casino, but by that point, the band were a staple throughout the world: a respected, adventurous, and successful group who could easily be called Britain's biggest band of the early 21st century."),
    Act(artist_name="Chaka Khan", stage_name="Diamond Stage", set_time="20:00", image="https://i1.wp.com/chakakhan.com/wp-content/uploads/2016/11/CK-on-Stage1.jpg?ssl=1", official_website="https://chakakhan.com/", genre="R&B", bio="Chaka Khan is one of the world's most gifted and celebrated musicians, with a rich musical legacy, the 10-time GRAMMY Award-winner is looking forward to a celebration of a lifetime. A songwriter, actor, author, philanthropist, entrepreneur and activist, Chaka Khan has influenced generations of recording artists. She has the rare ability to sing in seven music genres, including R&B, pop, rock, gospel, country, world music and classical. Affectionately known around the world as Chaka, she is revered by millions of fans as well as her peers for her timeless, classic and unmatched signature music style and ability. The late, great Miles Davis often said, She sings like my horn. And the Queen of Soul, Aretha Franklin says, Chaka is a one- of- a -kind, premier vocalist."),
    Act(artist_name="Kasabian", stage_name="Diamond Stage", set_time="19:00", image="https://www.justbookitnow.com/wp-content/uploads/2019/10/7a6397ec-7f39-429a-b610-9b3d8b5db3b0_1186281_TABLET_LANDSCAPE_LARGE_16_9.jpg", official_website="", genre="Rock", bio="Kasabian took the British press by storm in the early 2000s by confidence and influenced electronics. Named after Linda Kasabians getaway driver-turned-state witness, the Leicester-based group also took a page from  by moving into a remote farmhouse to brew its music. Communal life and a slew of shared influences produced an electronic, rock-oriented sound that harked back to the Madchester days of baggy pants and druggy dancing. Releasing their eponymous debut in 2004, Kasabian expanded that sound on later albums, but the band's foundation remained rooted in fragmented dance textures and boisterous rock & roll. The approach was well-received; the group went to the top of the U.K. album chart for the first time with 2006's Empire, and their sixth album, For Crying Out Loud, became their fifth straight number one when it arrived in 2017."),
    Act(artist_name="Lionel Richie", stage_name="Diamond Stage", set_time="18:00", image="https://hamptoncourtpalacefestival.com/imager/content/images/3437/lionel-2020-1x1_556e2c511f4993cc4bca6ddabeac8018.jpg", official_website="https://lionelrichie.com/", genre="R&B", bio="International superstar Lionel Richie has a discography of albums and singles that are second to none. His music is part of the fabric of pop music; in fact, Richie is one of only 2 songwriters in history to achieve the honor of having no. 1 records for 9 consecutive years. With more than 100 million albums sold worldwide, an Oscar, a Golden Globe, 4 Grammy Awards, the distinction of MusicCares Person of the Year in 2016, & Kennedy Center Honoree in 2017."),
    Act(artist_name="The White Stripes", stage_name="Diamond Stage", set_time="17:00", image="https://classicalbumsundays.com/wp-content/uploads/2014/06/whitestripesgetbehind.jpg", official_website="https://www.whitestripes.com/", genre="Rock", bio="With their unlikely but fascinating mix of arty concepts and raw sounds, the White Stripes were among the leaders of the early-2000s garage rock revival and helped define the sound of 21st century rock as the decade progressed. Jack and Meg White's clever use of limitations from their lineup to their instrumentation to their red, white, and black color scheme maximized their creativity, allowing them to bring a surprising number of facets to their seemingly back-to-basics approach. Meg's straight-ahead, minimalist drumming complemented Jack's freewheeling guitars and vocals perfectly, and their music touched on not only on obvious forebears such as the Gories and the Stooges, but also Son House and Blind Willie McTell's mythic blues, Led Zeppelin's riffs, the Gun Club's unhinged punk, and the timeless storytelling of country and folk legends such as Loretta Lynn and Bob Dylan."),
    Act(artist_name="Mahalia", stage_name="Diamond Stage", set_time="16:00", image="https://media.gq-magazine.co.uk/photos/5d13a819533a23706cc635e4/16:9/w_1920,c_limit/mahalia-hp-gq-26nov18_b.jpg", official_website="https://www.mahaliamusic.co.uk/", genre="R&B", bio="Mahalia is an alt-R&B/soul artist who counts Erykah Badu and Lauryn Hill among her biggest influences. The singer and songwriter made her recorded debut in her early teens, by which point she had already attracted major-label interest. She went on to sign with the Asylum label, where she has issued the albums Diary of Me (2016) and the considerably more individualistic Love and Compromise (2019), the latter of which peaked within the Top 30 of the album chart in her native U.K. Mahalia has also issued a handful of EPs including Isolation Tapes (2020)."),
    Act(artist_name="Daniel Caesar", stage_name="Diamond Stage", set_time="15:00", image="https://aestheticmag.files.wordpress.com/2016/09/img_0061danielcaesar-copy.jpg?w=750", official_website="https://danielcaesar.com/", genre="R&B", bio="With a captivating and intimate approach to songwriting, Canadian R&B singer/songwriter Daniel Caesar broke through in 2017 with several collaborative singles from his debut album Freudian. Duets with peers like H.E.R. and Kali Uchis were streamed hundreds of millions of times, and even brought Caesar Juno awards, multiple Grammy nominations in 2018, and a win at the next year's Grammys for Best R&B Performance."),
    Act(artist_name="Sampha", stage_name="Diamond Stage", set_time="14:00", image="https://sampha.com/__new/images/sampha-process.jpg", official_website="https://sampha.com/", genre="R&B", bio="Samphas artful and emotive mix of pop, R&B, and electronic music isn't easily categorizable, and is further distinguished by a heartfelt vocal style that tends to sound as if it's on the brink of choking back tears. Prior to releasing Process (2017), his debut album, the artist established himself as a valued remixer and studio collaborator sought by emergent underground talents and mainstream stars alike, including SBTRKT, Jessie Ware, Drake, Beyoncé, and Kanye West. After his first full-length won the Mercury Prize, he humbly continued to assist a similarly vast range of artists, including Roses Gabor and Florence + the Machine."),
    Act(artist_name="Shakka", stage_name="Diamond Stage", set_time="13:00", image="https://upload.wikimedia.org/wikipedia/commons/7/73/Chloe_Newman_Shakka_Hunger_23.jpg", official_website="https://open.spotify.com/artist/7fqDRFkiuwzFDde1K0taVs", genre="R&B", bio="The son of Dominican parents, left-field pop artist Shakka- a singer, songwriter, and producer -- was raised in London, England and was exposed to music at an early age by his father, a member of a reggae band. Shakka studied at London's Centre for Young Musicians and debuted in July 2009 with an EP, Foolishness, Vol. 1 - a mix of pop, rap, and reggae he deprecatingly referred to as the early babbling stages of a haphazard singer/songwriter. A conceptual mixtape release, The Shakka Crown Affair, followed in March 2011."), 
    Act(artist_name="Bloc Party", stage_name="Diamond Stage", set_time="12:00", image="https://vistapointe.net/images/bloc-party-2.jpg", official_website="https://www.instagram.com/thisisblocparty/?hl=en", genre="Rock", bio="East London art punkers Bloc Party mixed angular sonics with pop structures and helped shape the sound of British indie rock throughout the 2000s. Tense post-punk rhythms and dissonant guitar hooks took their cues from Gang of Four and Joy Division on the band's 2005 debut Silent Alarm."),
    Act(stage_name="The Lion Ring", set_time="12:00", artist_name="Lil' Kim", image="https://wwwbiography.com/.image/t_share/MTE4MDAzNDEwOTU0NzE2Njg2/lil-kim-sexy-magazine-cover.jpg",official_website="https://www.instagram.com/lilkimthequeenbee/?hl=en", genre="rap", bio="KimberlyDenise Jones (born July 11, 1974 or 1975), better known by her stage name Lil' Kim, is an Americanrapper, songwriter, and reality television personality. Born and raised in Brooklyn, New York City,she lived much of her adolescent life on the streets after being expelled from home. In her teens,Jones would freestyle rap, influenced by fellow female hip hop artists like MC Lyte and The Lady ofRage. In 1994, she was discovered by fellow rapper The Notorious B.I.G., who invited her to join hisgroup Junior M.A.F.I.A.; their debut album, Conspiracy, generated two top 20 singles in the UnitedStates and was certified gold by the Recording Industry Association of America (RIAA)."),
    Act(stage_name="The Lion Ring", set_time="13:00", artist_name="Childish Gambino", image="https://pbstwimg.com/profile_images/412281638756700161/abmtP9pO_400x400.jpeg", official_website="https:/donaldgloverpresents.com/", genre="rap", bio="Donald McKinley Glover Jr. (born September 25, 1983),also known by the stage name Childish Gambino, is an American actor, singer, rapper, stand-upcomedian, writer, producer, and director. Following several independently released albums andmixtapes, Glover signed with Glassnote Records in 2011.He released his first studio album, Camp, onNovember 15, 2011. His second studio album, Because the Internet, was released on December 10, 2013.Glover's third album, \"Awaken, My Love!\", was released on December 2, 2016, spawning the single\"Redbone\", which peaked at number twelve on the Billboard Hot 100 and eventually earned him hisfirst Grammy Award.In May 2018, Glover released the song and music video \"This Is America\", whichdebuted at number-one on the Hot 100. The song won four Grammy Awards at the 2019 ceremony: Record ofthe Year, Song of the Year, Best Rap/Sung Performance and Best Music Video. On March 22, 2020, hereleased his fourth studio album 3.15.20."),
    Act(stage_name="The Lion Ring", set_time="14:00", artist_name="Eve", image="https://www.biography.com/.image/ar_1:1%2Cc_fill%2Ccs_srgb%2Cg_face%2Cq_auto:good%2Cw_300/MTQ3Mzg3MjIzMDEwOTc2OTYx/eve_photo_by_michael_loccisano_film_magic_getty_76089113.jpg", official_website="https://www.instagram.com/therealeve/?hl=en", genre="rap", bio="Eve Jihan Jeffers Cooper (née Jeffers; born November 10, 1978), known professionally as Eve is an American rapper, singer-songwriter, actress, television presenter, and talk show hostess from Philadelphia.She has released four studio albums, Let There Be Eve...Ruff Ryders' First Lady (1999), Scorpion (2001), Eve-Olution (2002), and Lip Lock (2013). Eve achieved chart success with the singles, \"Let Me Blow Ya Mind\", \"Who's That Girl\", \"Gangsta Lovin'\" and \"Tambourine\". Besides solo materials, Eve earned chart-topping entries with collaborations, including \"Rich Girl\", \"4 My People\", \"Who's That Girl\", \"You Got Me\" and \"Like This\". Her accolades include a Grammy Award, BET Award, MTV Video Music Award, Teen Choice Award, Washington DC Area Film Critics Association Award and two Daytime Emmy Award nominations. Eve was ranked number 46 on VH1's list of 50 Greatest Hip Hop Artists."),
    Act(stage_name="The Lion Ring", set_time="15:00", artist_name="Kendrick Lamar", image="https://pyxisnymag.com/v1/imgs/59a/cdc/fc6e8a00ab4ba652cbf6bb6b4beebb527f-14-kendrick-lamar.rsquare.w700.jpg",official_website="http://www.kendricklamar.com/", genre="rap", bio="Kendrick Lamar Duckworth (bornJune 17, 1987) is an American rapper, songwriter, and record producer. Since his mainstream debut in2012 with Good Kid, M.A.A.D. City, Lamar has been regarded as one of the most influential artists ofhis generation, as well as one of the greatest rappers and lyricists of all time. Aside from his solocareer, he is also known as a member of the hip hop supergroup Black Hippy alongside his Top DawgEntertainment (TDE) label-mates Ab-Soul, Jay Rock, and Schoolboy Q."),
    Act(stage_name="The Lion Ring", set_time="16:00", artist_name="Lady Leshurr", image="https://pbs.twimg.com/profile_images/1368836192033267712/YolFMTte_400x400.jpg", official_website="https://www.instagram.com/imladyleshurr/", genre="rap", bio="Melesha Katrina O'Garro BEM (born 15 December 1988), known professionally as Lady Leshurr, is a British rapper, singer, songwriter and producer. She is known for her Queen's Speech series of freestyles the fourth of which became popular in 2016. Her subsequent freestyle, Queen's Speech 5, was called \"brilliant\" and \"2015's crowning freestyle\" by Spin.In 2021, she competed in the thirteenth series of Dancing on Ice."),
    Act(stage_name="The Lion Ring", set_time="17:00", artist_name="Eminem", image="https://pbs.twimg.com/profile_images/1218209106491793408/ZZ7zbeWL_400x400.jpg", official_website="https://www.eminem.com/", genre="rap", bio="Marshall Bruce Mathers III (born October 17, 1972), known professionally as Eminem, is an American rapper, songwriter, and record producer. Eminem is among the best-selling music artists of all time, with estimated worldwide sales of more than 220 million records. He is credited with popularizing hip hop in Middle America and is critically acclaimed as one of the greatest rappers of all time."),
    Act(stage_name="The Lion Ring", set_time="18:00", artist_name="Missy Elliott", image="https://pbs.twimgcom/profile_images/1252102940157972483/iVqrjcKP_400x400.jpg", official_website="https://wwwmissy-elliott.com/", genre="rap", bio="Melissa Arnette Elliott (born July 1, 1971)[1] is an Americanrapper, singer, songwriter, and record producer. She embarked on her music career with R&B girl groupSista in the early-mid 1990s and later became a member of the Swing Mob collective along with childhoodfriend and longtime collaborator Timbaland, with whom she worked on projects for American R&B actsAaliyah, 702, Total, and SWV. Following several collaborations and guest appearances, she launched hersolo career on July 15, 1997 with her debut album Supa Dupa Fly, which spawned the top 20 single \"SockIt 2 Me\". The album debuted at number three on the Billboard 200, the highest charting debut for afemale rapper at the time."),
    Act(stage_name="The Lion Ring", set_time="19:00", artist_name="Dr Dre", image="https://pbs.twimg.com/profile_images/1598289026/Dr.-Dre-Detox-Approved-Photo-for-twitter_400x400.jpg", official_website="https://www.drdre.com/", genre="rap", bio="Andre Romelle Young (born February 18, 1965), known professionally as Dr. Dre, is an American rapper, record producer, audio engineer, record executive, and entrepreneur. He is the founder and CEO of Aftermath Entertainment and Beats Electronics, and was previously co-owner and President of Death Row Records. Dr. Dre began his career as a member of the World Class Wreckin' Cru in 1985 and later found fame with the gangsta rap group N.W.A. The group popularized explicit lyrics in hip hop to detail the violence of street life. During the early 1990s, Dre was credited as a key figure in the crafting and popularization of West Coast G-funk, a subgenre of hip hop characterized by a synthesizer foundation and slow, heavy beats."),
    Act(stage_name="The Lion Ring", set_time="20:00", artist_name="Cardi B", image="https://pbs.twimg.com/profile_images/1356411407609319424/KbrH-zMk_400x400.jpg", official_website="http://www.cardib.com/", genre="rap", bio="Belcalis Marlenis Almánzar (born October 11, 1992), known professionally as Cardi B, is an American rapper, songwriter, and actress.Born in Manhattan and raised in the Bronx, New York City, she became an Internet celebrity by achieving popularity on Vine and Instagram. From 2015 to 2017, she appeared as a regular cast member on the VH1 reality television series Love & Hip Hop: New York, which depicted her pursuit of her music aspirations. She released two mixtapes—Gangsta Bitch Music, Vol. 1 and Vol. 2, before signing with label Atlantic Records in early 2017. Recognized by Forbes as one of the most influential female rappers of all time, Cardi B is known for her aggressive flow and candid lyrics, which have received widespread media coverage."),
    Act(stage_name="The Lion Ring", set_time="21:00", artist_name="Snoop Dogg", image="https://pbs.twimg.com/profile_images/1162394412845944832/iruV4hUN_400x400.jpg", official_website="https://snoopdogg.com/?__cf_chl_jschl_tk__=7f91dd51b46048998228b2d587b62bc88233502d-1615414075-0-ATRdAek685_P0g1a1LSMlu39ynsn1W-hMOz1fxJETdD4xftizriOvJ4R2ycPVhgry1VUakTAR6ekDyC2oC2A23yYgS5zooNizxEToAIDWLuYPcBbhqZ4hwSIfWkrzZoTv9A4aZJH6D1UKjVgvz0lzG90gynIKvuHqkhDKaqAdXuaxwao_B9b6W9K-kSi5p3FLftIEffDNlPMrw8DGXnnMnhEdUoMFpdgJRTGa57PViQkpvvLtUveGWM2tqYy5VxZMuwXGGIcCJCNKa2XmHKmfjkt2psxgT31hF64lFF7nK3om-XNw-Xyd4Kp-GSbrLN9Ag", genre="rap", bio="Calvin Cordozar Broadus Jr. (born October 20, 1971), known professionally as Snoop Dogg (previously Snoop Doggy Dogg and briefly Snoop Lion), is an American rapper and media personality. His fame dates to 1992 when he featured on Dr. Dre's debut solo single, \"Deep Cover\", and then on Dre's debut solo album, The Chronic. Snoop has since sold over 23 million albums in the United States and 35 million albums worldwide."),
    Act(stage_name="The Lion Ring", set_time="22:00", artist_name="Nicki Minaj", image="https://pbs.twimg.com/profile_images/1329651055806750722/dCDLucpV_400x400.jpg", official_website="https://www.instagram.com/nickiminaj/", genre="rap", bio="Onika Tanya Maraj-Petty (born December 8, 1982), known professionally as Nicki Minaj, is a Trinidadian-American[disputed – discuss] rapper, singer, songwriter, actress, philanthrophist, and model. Born in the Saint James district of Port of Spain, Trinidad and Tobago and raised in the Queens borough of New York City, she gained public recognition after releasing the mixtapes Playtime Is Over (2007), Sucka Free (2008), and Beam Me Up Scotty (2009). Cited as one of the most influential female rap artists of all time, Minaj became the first female rapper to sell an estimated 100 million records worldwide, making her one of the world's best selling music artists and placing 5th in best selling female artists across all genres.Throughout her career, Minaj has received numerous accolades, including six American Music Awards, twelve BET Awards, four MTV Video Music Awards, four Billboard Music Awards, and two Billboard Women in Music Awards. She has also been nominated for 10 Grammy Awards. She is the most awarded female rapper in history. Minaj is the highest-ranked female rapper on Billboard's list of the top artists of the 2010s.In 2016, Minaj was included on the annual Time list of the 100 most influential people in the world. She became the first female rapper to pass a net worth of $100 million."),
